import React, { useEffect, useState } from 'react';
import '../App.css';


function Stations() {

  const [myData, setData] = useState([])

  useEffect(()=>{
    fetch('pollination').then(response =>
       response.json().then(da =>{
         setData(da);
       }
     ));

  }, []);


  return (
    <div>
           <h1> {myData} </h1>
    </div>
  );
}
export default Stations;
